import React from 'react'

function Card(props) {
    const getCard = props.card
    return (  
        <div>
            {getCard.map((items)=>
            <div>
                <p>{items.name}</p>
                <img style={{width:"100px",height:"100px"}} src={items.avatar}/>
                <p>{items.gianguoilon}</p>
            </div>
        ) 
        }
        </div>
    )
}

export default Card
